
App.Fields={Colors:{getColorContrast:function(f){var d=parseInt(f.substr(0,2),16);var c=parseInt(f.substr(2,2),16);var a=parseInt(f.substr(4,2),16);var e=((d*299)+(c*587)+(a*114))/1000;return(e>=128)?"light":"dark"},getRandomColor:function(){var c="0123456789ABCDEF".split("");var a="#";for(var b=0;b<6;b++){a+=c[Math.floor(Math.random()*16)]}return a},getRandomColors:function(c){const a=[];for(var b=0;b<c;b++){a.push(this.getRandomColor())}return a}},Password:{registerCopyClipboard:function(a){if(a==undefined){a=".clipboard"}return new ClipboardJS(a,{text:function(b){Vtiger_Helper_Js.showPnotify({text:app.vtranslate("JS_NOTIFY_COPY_TEXT"),type:"success"});b=jQuery(b);var c=jQuery(b.data("copyTarget"));var d;if(typeof b.data("copyType")!=="undefined"){if(c.is("select")){d=c.find("option:selected").data(b.data("copyType"))}else{d=c.data(b.data("copyType"))}}else{if(typeof b.data("copy-attribute")!=="undefined"){d=b.data(b.data("copy-attribute"))}else{d=c.val()}}return d}})},}};